import { Formik, Form } from "formik"
import Input from './Input'


const Formulario = ({ setBusqueda }) => {
    return(
        <Formik
            initialValues={{
                busqueda: '',
            }}

        >
            <Form>
                <Input />
                <button>Buscar</button>
            </Form>
        </Formik>
    )
}

export default Formulario
